import React, { useState, useEffect } from "react";
import axios from "axios";

const CreateTicket = () => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [categoryId, setCategoryId] = useState("");
  const [priorityId, setPriorityId] = useState("");
  const [categories, setCategories] = useState([]);
  const [priorities, setPriorities] = useState([]);

  const token = localStorage.getItem("token");

  useEffect(() => {
    // Categori ve priority 
    const fetchData = async () => {
      try {
        const [catRes, priRes] = await Promise.all([
          axios.get("http://localhost:5094/api/Categories", {
            headers: { Authorization: `Bearer ${token}` },
          }),
          axios.get("http://localhost:5094/api/Priorities", {
            headers: { Authorization: `Bearer ${token}` },
          }),
        ]);
        setCategories(catRes.data);
        setPriorities(priRes.data);
      } catch (error) {
        console.error("Veri alınırken hata:", error);
      }
    };
    fetchData();
  }, [token]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post(
        "http://localhost:5094/api/Tickets",
        {
          title,
          description,
          categoryId,
          priorityId,
        },
        {
          headers: { Authorization: `Bearer ${token}` },
        }
      );
      alert("Ticket başarıyla oluşturuldu.");
      setTitle("");
      setDescription("");
      setCategoryId("");
      setPriorityId("");
    } catch (error) {
      alert("Ticket oluşturulurken hata: " + error.message);
    }
  };

  return (
    <div>
      <h2>Yeni Ticket Oluştur</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Başlık:</label><br />
          <input
            type="text"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
          />
        </div>

        <div>
          <label>Açıklama:</label><br />
          <textarea
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            required
          />
        </div>

        <div>
          <label>Kategori:</label><br />
          <select
            value={categoryId}
            onChange={(e) => setCategoryId(e.target.value)}
            required
          >
            <option value="">Seçiniz</option>
            {categories.map((cat) => (
              <option key={cat.id} value={cat.id}>
                {cat.name}
              </option>
            ))}
          </select>
        </div>

        <div>
          <label>Öncelik:</label><br />
          <select
            value={priorityId}
            onChange={(e) => setPriorityId(e.target.value)}
            required
          >
            <option value="">1</option>
            {priorities.map((pri) => (
              <option key={pri.id} value={pri.id}>
                {pri.name}
              </option>
            ))}
            <option value="">2</option>
            {priorities.map((pri) => (
              <option key={pri.id} value={pri.id}>
                {pri.name}
              </option>
            ))}
            <option value="">3</option>
            {priorities.map((pri) => (
              <option key={pri.id} value={pri.id}>
                {pri.name}
              </option>
            ))}
          </select>
        </div>

        <button type="submit">Oluştur</button>
      </form>
    </div>
  );
};

export default CreateTicket;
